import React from "react";
import "./App.css";

function App() {
  return (
    <div className="flex justify-center items-center h-screen bg-gray-100">
      <div className="text-center">
        <h1 className="text-4xl font-bold text-blue-600">Welcome to React!</h1>
        <p className="mt-4 text-xl text-gray-700">Now styled with Tailwind CSS</p>
        <a
          href="https://reactjs.org"
          className="mt-6 inline-block text-lg text-blue-500 hover:text-blue-700"
        >
          Visit the React website
        </a>
      </div>
    </div>
  );
}

export default App;
